import React, {useState, useEffect} from 'react'

function HookCounter111() {
const [count, setCount] = useState(0)

useEffect(() => {
    document.title()
})

  return (
    <div>
      <button onClick={() => setCount(count + 1)}>Count {count} times </button>
    </div>
  )
}

export default HookCounter111
